import './App.css';
import React, { useState,useEffect } from 'react';
import axios from "axios";

function Todo({ todo }) {
  return (
    <div className="todo">
      {todo.id}
      <div>
      <button></button>
    </div>
    </div>

  );
};
function App() {
  const [todos,SetTodos] = useState([])

  useEffect(() => {

    axios
    .get("http://127.0.0.1:8000/api/todos/")
    .then((res) => {
      console.log(res.data)
      SetTodos(res.data)
    })
    .catch((err) => console.log(err))


  }, [])


  return (
    <div className="App">
       {todos.map((todo, index) => (
          <Todo
            key={index}
            index={index}
            todo={todo}
          />
        ))} 
    </div>
  );
}

export default App;
